import React from 'react'
import back from "../assets/svg/back.svg"
import cart from "../assets/svg/chart.svg"

function ProductDetails() {
    return (
        <div className="container d-flex flex-row gap-x3 m-5">
            <img src={back} alt="" />
            <img src={cart} alt="" />


        </div>
    )
}

export default ProductDetails
